(1, 1, '2023-10-16 20:56:02', '2023-10-16 20:56:02', '<!-- wp:paragraph -->\n<p>Bienvenido a WordPress. Esta es tu primera entrada. Edtala o brrala, luego empieza a escribir!</p>\n<!-- /wp:paragraph -->', 'Hola mundo!', '', 'publish', 'open', 'open', '', 'hola-mundo', '', '', '2023-10-16 20:56:02', '2023-10-16 20:56:02', '', 0, 'https://c2c8.concepthaus.uk/?p=1', 0, 'post', '', 1);
INSERT INTO `chdb_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES
(2, 1, '2023-10-16 20:56:02', '2023-10-16 20:56:02', '<!-- wp:paragraph -->\n<p>Esta es una pgina de ejemplo. Es diferente a una entrada del blog porque permanecer en un solo lugar y aparecer en la navegacin de su sitio (en la mayora de los temas). La mayora de las personas comienzan con una pgina \"Acerca de\" que les presenta a los visitantes potenciales del sitio. Podra decir algo as:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Bienvenido! Soy camarero de da, aspirante a actor de noche y esta es mi web. Vivo en Morelia, tengo un perro que se llama Firulais y me gusta el mezcal. (Y las tardes largas con caf)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>o algo as:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>La empresa Mariscos Recio fue fundada por Antonio Recio Mata. Empez siendo una pequea empresa que suministraba marisco a hoteles y restaurantes, pero poco a poco se ha ido transformando en un gran imperio. Mariscos Recio, el mar al mejor precio.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Como nuevo usuario de WordPress, deberas ir a <a href=\"https://c2c8.concepthaus.uk/wp-admin/\">tu escritorio</a> para borrar esta pgina y crear nuevas pginas para tu contenido. Psalo bien!</p>\n<!-- /wp:paragraph -->', 'Pgina de ejemplo', '', 'publish', 'closed', 'open', '', 'pagina-ejemplo', '', '', '2023-10-16 20:56:02', '2023-10-16 20:56:02', '', 0, 'https://c2c8.concepthaus.uk/?page_id=2', 0, 'page', '', 0);
