(3, 1, '2023-10-16 20:56:02', '2023-10-16 20:56:02', '<!-- wp:heading --><h2>Quines somos</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>La direccin de nuestra web es: https://c2c8.concepthaus.uk.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Comentarios</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Cuando los visitantes dejan comentarios en la web, recopilamos los datos que se muestran en el formulario de comentarios, as como la direccin IP del visitante y la cadena de agentes de usuario del navegador para ayudar a la deteccin de spam.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Una cadena annima creada a partir de tu direccin de correo electrnico (tambin llamada hash) puede ser proporcionada al servicio de Gravatar para ver si la ests usando. La poltica de privacidad del servicio Gravatar est disponible aqu: https://automattic.com/privacy/. Despus de la aprobacin de tu comentario, la imagen de tu perfil es visible para el pblico en el contexto de su comentario.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Medios</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Si subes imgenes a la web deberas evitar subir imgenes con datos de ubicacin (GPS EXIF) incluidos. Los visitantes de la web pueden descargar y extraer cualquier dato de localizacin de las imgenes de la web.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Cookies</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Si dejas un comentario en nuestro sitio puedes elegir guardar tu nombre, direccin de correo electrnico y web en cookies. Esto es para tu comodidad, para que no tengas que volver a rellenar tus datos cuando dejes otro comentario. Estas cookies tendrn una duracin de un ao.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Si tienes una cuenta y te conectas a este sitio, instalaremos una cookie temporal para determinar si tu navegador acepta cookies. Esta cookie no contiene datos personales y se elimina al cerrar el navegador.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Cuando inicias sesin, tambin instalaremos varias cookies para guardar tu informacin de inicio de sesin y tus opciones de visualizacin de pantalla. Las cookies de inicio de sesin duran dos das, y las cookies de opciones de pantalla duran un ao. Si seleccionas &quot;Recordarme&quot;, tu inicio de sesin perdurar durante dos semanas. Si sales de tu cuenta, las cookies de inicio de sesin se eliminarn.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Si editas o publicas un artculo se guardar una cookie adicional en tu navegador. Esta cookie no incluye datos personales y simplemente indica el ID del artculo que acabas de editar. Caduca despus de 1 da.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Contenido incrustado de otros sitios web</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Los artculos de este sitio pueden incluir contenido incrustado (por ejemplo, vdeos, imgenes, artculos, etc.). El contenido incrustado de otras web se comporta exactamente de la misma manera que si el visitante hubiera visitado la otra web.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Estas web pueden recopilar datos sobre ti, utilizar cookies, incrustar un seguimiento adicional de terceros, y supervisar tu interaccin con ese contenido incrustado, incluido el seguimiento de tu interaccin con el contenido incrustado si tienes una cuenta y ests conectado a esa web.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Con quin compartimos tus datos</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Si solicitas un restablecimiento de contrasea, tu direccin IP ser incluida en el correo electrnico de restablecimiento.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Cunto tiempo conservamos tus datos</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Si dejas un comentario, el comentario y sus metadatos se conservan indefinidamente. Esto es para que podamos reconocer y aprobar comentarios sucesivos automticamente en lugar de mantenerlos en una cola de moderacin.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>De los usuarios que se registran en nuestra web (si los hay), tambin almacenamos la informacin personal que proporcionan en su perfil de usuario. Todos los usuarios pueden ver, editar o eliminar su informacin personal en cualquier momento (excepto que no pueden cambiar su nombre de usuario). Los administradores de la web tambin pueden ver y editar esa informacin.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Qu derechos tienes sobre tus datos</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Si tienes una cuenta o has dejado comentarios en esta web, puedes solicitar recibir un archivo de exportacin de los datos personales que tenemos sobre ti, incluyendo cualquier dato que nos hayas proporcionado. Tambin puedes solicitar que eliminemos cualquier dato personal que tengamos sobre ti. Esto no incluye ningn dato que estemos obligados a conservar con fines administrativos, legales o de seguridad.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Dnde se envan tus datos</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Los comentarios de los visitantes puede que los revise un servicio de deteccin automtica de spam.</p><!-- /wp:paragraph -->', 'Poltica de privacidad', '', 'draft', 'closed', 'closed', '', 'privacidad', '', '', '2023-11-07 04:35:52', '2023-11-07 04:35:52', '', 0, 'https://c2c8.concepthaus.uk/?page_id=3', 0, 'page', '', 0);
