(26, 1, '2023-10-19 22:24:32', '2023-10-19 22:24:32', 'La riqueza de esta experiencia nos lleva desde el corazn del Ro Huitzilapan o Ro de los colibres en Jalcomulco hasta los cafetales de una antigua finca en Coatepec. Recorreremos sus barrancas, probaremos sus frutos exticos como la pomarrosa y observaremos animales silvestres. Todo a 5 horas de la CDMX y a 1 hora de Xalapa.', 'Jalcomulco', 'La riqueza de esta experiencia nos lleva desde el corazn del Ro Huitzilapan o Ro de los colibres en Jalcomulco hasta los cafetales de una antigua finca en Coatepec. Recorreremos sus barrancas, probaremos sus frutos exticos como la pomarrosa y observaremos animales silvestres. Todo a 5 horas de la CDMX y a 1 hora de Xalapa.', 'publish', 'open', 'closed', '', 'jalcomulco', '', '', '2023-11-07 01:45:55', '2023-11-07 01:45:55', '', 0, 'https://c2c8.concepthaus.uk/?post_type=product&#038;p=26', 0, 'product', '', 0),
