(57, 1, '2023-10-20 02:27:58', '2023-10-20 02:27:58', 'Conoce ms sobre este challenge\n<ul>\n 	<li>Challenge:</li>\n 	<li>Tipo de causa: Cuenca Amanalco - Valle de Bravo</li>\n 	<li>Duracin: 2 das y una noche</li>\n 	<li>Nivel fsico: Intermedio**</li>\n 	<li>Nivel tcnico: Principiante</li>\n 	<li>Punto de encuentro: CDMX</li>\n 	<li>Inicia en: Faldas del Nevado de TolucaTermina en: Valle de Bravo</li>\n</ul>\n* Entrenamiento fsico previo\nIncluye: Transporte redondo, hospedaje, alimentos,\nbebidas y gua\nSe recomienda llevar: Prendas cmodas y abrigadoras, mochila campista, artculos tiles varios de uso personal y para camping\n<h1>Costo: $4,500 mxn</h1>\n<h6>(por persona) IVA incluido</h6>', 'Nevado a Valle', 'En esta caminata podrs conocer uno de los bosques ms profundos de Mxico en una expedicin desde la parte baja del Nevado de Toluca hasta Valle de Bravo.\nEl sendero ofrece varios miradores donde puedes detenerte y disfrutar de las vistas impresionantes de los valles y montaas.', 'inherit', 'closed', 'closed', '', '12-autosave-v1', '', '', '2023-10-20 02:27:58', '2023-10-20 02:27:58', '', 12, 'https://c2c8.concepthaus.uk/?p=57', 0, 'revision', '', 0);
