(76, 'tap_to_pay_iphone_q4_2023_with_woopayments', 'marketing', 'en_US', 'New: accept in-person contactless payments on your iPhone', 'Tap to Pay on iPhone is quick, secure, and simple to set up in WooPayments  no extra terminals or card readers are needed. Accept contactless debit and credit cards, Apple Pay, and other NFC digital wallets in person in a few short steps!', '{}', 'pending', 'woocommerce.com', '2023-12-08 08:30:49', NULL, 0, 'plain', '', 0, 0, 'info');
